import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div className="footer py-5">
        <div class="ht-tm-element btn-group btn-group-toggle" data-toggle="buttons">
        <label class="btn btn-outline-primary active"><input type="radio" name="options" id="radio-option-1" autocomplete="off" checked=""> Radio 1</input> </label>
            <label class="btn btn-outline-primary">
            <input type="radio" name="options" id="radio-option-2" autocomplete="off"> Radio 2</input> </label>
        </div>
      </div>
            
        
      
    );
  }
}

export default Footer;
